import React from 'react'

export default function TodoForm() {
  return (
    <form className='TodoForm'>
        <input type="text" 
        className='todo-input' 
        placeholder='Veuillez entrez votre tache' />
        <button type='submit' className='todo-btn'>
        Ajouter tache
        </button>

    </form>
  )
}
